import React from 'react';
import Tilt from 'react-tilt';
import face from './face.png';
import './Logo.css'

const Logo = () => {
    return (
        <div className = 'logo ma4 mt4'>
        <Tilt className="Tilt br2 shadow-2" options={{ max : 55 }} style={{ height: 150, width: 150 }} >
        <div className="Tilt-inner pa3"><img style = {{paddingTop: '5px'}} src={face} alt="recog-logo"></img> </div>
        </Tilt>
        </div>
    )
}

export default Logo;
